class JustForFun extends React.Component {
	constructor() {
		super()
		this.state = {
			name: "Soumya",
			desc: "Fuck you"
		}
	}

	changeState() {
		this.setState({desc: "Daba Diya"})
	}

	render() {
		return (<h1>
			Hello {this.state.name}!!{this.state.desc}!!
			<button onClick={() => this.changeState()}>Daba Mujhe</button>
		</h1>)
	}
}

export default JustForFun;
